-- Database Creation
-- Data Import via Python Script

DROP DATABASE IF EXISTS yahoo_stocks;
CREATE DATABASE yahoo_stocks;
USE yahoo_stocks;

CREATE TABLE Companies (
    CompanyID VARCHAR(255) PRIMARY KEY,
    Name VARCHAR(255),
    Sector VARCHAR(255),
    Industry VARCHAR(255),
    Location VARCHAR(255),
    DateAdded DATE,
    CIK VARCHAR(255),
    Founded YEAR,
    INDEX idx_symbol (CompanyID)
);

CREATE TABLE StockPrices (
    Date DATE,
    Open FLOAT,
    High FLOAT,
    Low FLOAT,
    Close FLOAT,
    Adj_Close FLOAT,
    Volume BIGINT,
    Symbol VARCHAR(255),
    FOREIGN KEY (Symbol) REFERENCES Companies(CompanyId)
);

CREATE TABLE Dividends (
    Symbol VARCHAR(255),
    AnnualDiv FLOAT,
    FOREIGN KEY (Symbol) REFERENCES Companies(CompanyId)
);

