-- SQL FOR ANALYTICAL LAYER
-- Stock Prices with Daily Returns View
CREATE VIEW StockPricesWithReturns AS
SELECT
    Date,
    Open,
    High,
    Low,
    Close,
    Adj_Close,
    Volume,
    Symbol,
    (Close - Lag(Close) OVER (PARTITION BY Symbol ORDER BY Date)) / Lag(Close) OVER (PARTITION BY Symbol ORDER BY Date) AS Daily_Return
FROM
    StockPrices;

-- Combined Analytics Table
CREATE TABLE CombinedAnalytics AS
SELECT
    d.Symbol,
    d.AnnualDiv,
    s.Date,
    s.Open,
    s.High,
    s.Low,
    s.Close,
    s.Adj_Close,
    s.Volume
FROM
    Dividends d
JOIN
    StockPrices s ON d.Symbol = s.Symbol;
    
ALTER TABLE CombinedAnalytics
ADD COLUMN Daily_Return FLOAT;

-- Sector and Industry Analytics Table
CREATE TABLE SectorIndustryAnalytics AS
SELECT
    c.Sector,
    c.Industry,
    AVG(d.AnnualDiv) AS Avg_AnnualDiv,
    AVG(s.Adj_Close - s.Open) AS Avg_DailyReturn
FROM
    Companies c
JOIN
    Dividends d ON c.CompanyID = d.Symbol
JOIN
    StockPrices s ON c.CompanyID = s.Symbol
GROUP BY
    c.Sector, c.Industry;

-- ETL PIPELINE
-- Create ETL Procedure for Dividends
DELIMITER //
CREATE PROCEDURE ETL_Dividends()
BEGIN
    -- Extract data from source
    INSERT INTO CombinedAnalytics (Symbol, AnnualDiv)
    SELECT Symbol, AnnualDiv FROM Dividends;
END //
DELIMITER ;

-- Create ETL Procedure for Sector and Industry Analytics
DELIMITER //
CREATE PROCEDURE ETL_SectorIndustryAnalytics()
BEGIN
    -- Extract data from source
    INSERT INTO SectorIndustryAnalytics (Sector, Industry, Avg_AnnualDiv, Avg_DailyReturn)
    SELECT c.Sector, c.Industry, AVG(d.AnnualDiv), AVG(s.Adj_Close - s.Open)
    FROM Companies c
    JOIN Dividends d ON c.CompanyID = d.Symbol
    JOIN StockPrices s ON c.CompanyID = s.Symbol
    GROUP BY c.Sector, c.Industry;

    -- Load data into the analytical layer
END //

DELIMITER ;

-- RUN ETL PROCEDURES
CALL ETL_Dividends();
CALL ETL_SectorIndustryAnalytics();

-- Create the initial materialized view
CREATE TABLE MyMaterializedView AS
SELECT
    Symbol,
    AVG(AnnualDiv) AS AvgAnnualDiv
FROM
    Dividends
GROUP BY
    Symbol;

-- Create a trigger to update the materialized view when the Dividends table changes
DELIMITER //

CREATE TRIGGER trg_Dividends_AfterInsert
AFTER INSERT
ON Dividends
FOR EACH ROW
BEGIN
    -- Update the materialized view when new data is inserted into the Dividends table
    REPLACE INTO MyMaterializedView (Symbol, AvgAnnualDiv)
    SELECT
        Symbol,
        AVG(AnnualDiv) AS AvgAnnualDiv
    FROM
        Dividends
    GROUP BY
        Symbol;
END //

DELIMITER ;

-- Create an event to periodically refresh the materialized view
DELIMITER //

-- MATERALIZED VIEWS WITH EVENTS
CREATE EVENT evt_RefreshMaterializedView
ON SCHEDULE EVERY 1 DAY -- Adjust the schedule as needed
DO
BEGIN
    -- Update the materialized view daily
    REPLACE INTO MyMaterializedView (Symbol, AvgAnnualDiv)
    SELECT
        Symbol,
        AVG(AnnualDiv) AS AvgAnnualDiv
    FROM
        Dividends
    GROUP BY
        Symbol;
END //

DELIMITER ;



